== Construction and Commissioning ==

The section on construction says "the contract to build her was awarded to Devonport Dockyard, of Portsmouth." This makes no sense. [[HMNB Devonport|Devonport]] is in [[Devonport, Devon|Devonport]], not Portsmouth! [[User:DuncanHill|DuncanHill]] ([[User talk:DuncanHill|talk]]) 13:55, 14 June 2010 (UTC)
:I've assumed that "Portsmouth" was a slip for "Plymouth", and changed the text accordingly. [[User:DuncanHill|DuncanHill]] ([[User talk:DuncanHill|talk]]) 17:32, 4 September 2010 (UTC)
